import React from 'react';
import "../styles/Work.css";

function Work() {
    return (<div className="work">
        <div className="bg">
            <img className="background" src="../images/sky_background.jpg" alt=""/>

        </div>

        <h1 className="title">My Work</h1>
        <div className="projectList"></div>

    </div>);
}

export default Work;
